import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import styles from '../styles/scss/share.module.scss';

const Share = () => {
	return (
		<div className={styles.shareBtn}>
			<FontAwesomeIcon icon="users" />
			Share
		</div>
	);
};

export default Share;
